const Item = () =>{
    return(
        <li>
            {props.item.titulo}
            <input type='checkbox' checked={props.item.completado} 
            onChange={()=>props.actualizar(props.index)}></input>
            <button onClick={()=>props.eliminar(props.index)}>Eliminar</button>
       </li>
   );
}

export default Item;
